import React from 'react'
import "./Cart.css"
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';

export default function Cart(props) {
    let arr1 = props.arr;
    return (
        <main id="m1">
            {console.log(props.arr)}
            {console.log(props.arr.length)}
            {
                (props.arr.length === 0) ? <p id="p">Product list is empty...</p> : arr1.map((val) => {
                    if(val.product!=="" && val.price!==""){
                    console.log(val);
                    return (<div >
                        <li id='d'><div>
                            <div><b>Name of produt: </b>{val.product}</div>
                            <div><b>Price: </b>{val.price}</div>
                            <div>
                                <button type="button" className="btn btn-danger">-</button>
                                <button type="button" className="btn btn-warning">0</button>
                                <button type="button" className="btn btn-success">+</button>
                            </div>
                        </div>
                        <button type="button" className="btn btn-dark" onClick={() => {
                            arr1 = props.arr.filter((val1) => {
                                if (val1.product !== val.product){
                                    return val1;
                                }
                                return {product: "", price: ""};
                            })
                        }}>Delete</button>
                    </li></div>)
                    }
                })
            }
            {console.log(arr1)}
            {console.log(arr1.length)}
        </main>
    )
}
